import React from 'react';
import logo from '../assets/gugol-300.png';
import SearchBar from '../Components/SearchBar'


export const LandingPage = ({ word, setWord }) => {
  return (
    <div>
      <img src={logo} alt="Gugol" class="center" />
      <SearchBar word={word} setWord={setWord}/>
    </div>
  );
}
